import PortfolioCard from '../PortfolioCard';


const projects = [
  {
      title: 'Projet 1',
      description: 'Description rapide de votre premier projet.',
      image: 'project1.jpg',
      link: '#'
  },
  {
      title: 'Projet 2',
      description: 'Un aperçu rapide du projet numéro deux.',
      image: 'project2.jpg',
      link: '#'

  },
  {
      title: 'Projet 3',
      description: 'Un autre projet intéressant qui montre votre créativité.',
      image: 'project3.jpg',
      link: '#'

  },
  {
      title: 'Projet 4',
      description: 'Une réalisation unique où vous avez utilisé une technologie spécifique.',
      image: 'project4.jpg',
      link: '#'

  },
  {
      title: 'Projet 5',
      description: 'Détails d’un autre projet qui vous distingue des autres.',
      image: 'project5.jpg',
      link: '#'

  },
  {
      title: 'Projet 6',
      description: 'Un dernier projet mettant en avant vos capacités.',
      image: 'project6.jpg',
      link: '#'

  },
];

const PorteFolio = () => {
  return (
    <>

    
    <div>
      <h1>Porte Folio</h1>
    </div>
    <div className="container my-5">
            <div className="row g-4">
                {projects.map((project, index) => (
                    <PortfolioCard
                        key={index}
                        title={project.title}
                        description={project.description}
                        image={project.image}
                        link={project.link}
                        techno={project.techno}
                    />
                ))}
            </div>
        </div>

   
    
    
    </>
    
  )
  }
  
  export default PorteFolio;
